import React, { Component } from 'react';
import BoozeCard from './BoozeCard';

export default class BoozeList extends Component {
	generateCards() {
		return this.props.cocktails.map(c => <BoozeCard key={c.id} cocktail={c} />);
	}

	render() {
		return <div className="ui cards">{this.generateCards()}</div>;
	}
}
